        return (
            <div className={'col-lg-12 mt-lg-5 ml-lg-0 pl-lg-0'}>
                <div className={'write-message-zone rounded text-left pt-lg-3 pl-lg-3 mt-sm-2'}>
                    Ecrire un message sur #CoursJAVAAvances
                </div>
            </div>
        )
    }
}

